(270, 'JUSTLE', 'To run or strike against each other; to encounter; to clash; tojostle. Shak.The chariots shall rage in the streets; they shall justle one againstanother in the broad ways. Nahum ii. 4.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/justle.mp3'),
(271, 'JAG', 'A cleft or division. Jag bolt, a bolt with a nicked or barbedshank which resists retraction, as when leaded into stone.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jag.mp3'),
(272, 'JOURNEYER', 'One who journeys.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/journeyer.mp3'),
(273, 'JUBATE', 'Fringed with long, pendent hair.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jubate.mp3'),
(274, 'JARBLE', 'To wet; to bemire. [Prov. Eng.] Halliwell.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jarble.mp3'),
(275, 'JAVELINIER', 'A soldier armed with a javelin. Holland.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/javelinier.mp3'),
(276, 'JUGLANDIN', 'An extractive matter contained in the juice of the green shucksof the walnut (Juglans regia). It is used medicinally as analterative, and also as a black hair dye.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/juglandin.mp3'),
(277, 'JOVE', 'The planet Jupiter. [R.] Pope.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jove.mp3'),
(278, 'JOUISSANCE', 'Jollity; merriment. [Obs.] Spenser.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jouissance.mp3'),
(279, 'JERKIN', 'A jacket or short coat; a close waistcoat. Shak.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jerkin.mp3'),
(280, 'JUDGER', 'One who judges. Sir K. Digby.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/judger.mp3'),
(281, 'JUBILANT', 'Uttering songs of triumph; shouting with joy; triumphant;exulting. "The jubilant age." Coleridge.While the bright pomp ascended jubilant. Milton.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jubilant.mp3'),
(282, 'JERBOA', 'Any small jumping rodent of the genus Dipus, esp. D. Ã†gyptius,which is common in Egypt and the adjacent countries. The jerboas havevery long hind legs and a long tail. [Written also gerboa.]', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jerboa.mp3'),
(283, 'JAYHAWKER', 'A name given to a free-booting, unenlisted, armed man orguerrilla.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jayhawker.mp3'),
(284, 'JAWN', 'See Yawn. [Obs.] Marston.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jawn.mp3'),
(285, 'JERUSALEM', 'The chief city of Palestine, intimately associated with theglory of the Jewish nation, and the life and death of Jesus Christ.Jerusalem artichoke Etym: [Perh. a corrupt. of It. girasole i.e.,sunflower, or turnsole. See Gyre, Solar.] (Bot.) (a) An Americanplant, a perennial species of sunflower (Helianthus tuberosus), whosetubers are sometimes used as food. (b) One of the tubers themselves.-- Jerusalem cherry (Bot.), the popular name of either of either oftwo species of Solanum (S. Pseudo-capsicum and S. capsicastrum),cultivated as ornamental house plants. They bear bright red berriesof about the size of cherries.-- Jerusalem oak (Bot.), an aromatic goosefoot (Chenopodium Botrys),common about houses and along roadsides.-- Jerusalem sage (Bot.), a perennial herb of the Mint family(Phlomis tuberosa).-- Jerusalem thorn (Bot.), a spiny, leguminous tree (Parkinsoniaaculeata), widely dispersed in warm countries, and used for hedges.-- The New Jerusalem, Heaven; the Celestial City.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jerusalem.mp3'),
(286, 'JAZEL', 'A gem of an azure color. [Obs.]', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jazel.mp3'),
(287, 'JOSTLEMENT', 'Crowding; hustling.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jostlement.mp3'),
(288, 'JOSTLE', 'To run against and shake; to push out of the way; to elbow; tohustle; to disturb by crowding; to crowd against. "Bullies jostledhim." Macaulay.Systems of movement, physical, intellectual, and moral, which areperpetually jostling each other. I. Taylor.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/jostle.mp3');
