(302, 'KECKSY', 'The hollow stalk of an umbelliferous plant, such as the cowparsnip or the hemlock. [Written also kex, and in pl., kecks, kaxes.]Nothing teems But hateful docks, rough thistles, kecksies, burs.Shak.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/kecksy.mp3'),
