(308, 'KOPECK', 'A small Russian coin. One hundred kopecks make a rouble, worthabout sixty cents. [Written also kopek, copec, and copeck.]', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/kopeck.mp3'),
(309, 'KNIGHT MARSHAL', 'An officer in the household of the British sovereign, who hascognizance of transgressions within the royal household and verge,and of contracts made there, a member of the household being one ofthe parties. Wharton.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/knight marshal.mp3'),
