(319, 'KNIGHTLY', 'Of or pertaining to a knight; becoming a knight; chivalrous;as, a knightly combat; a knightly spirit.For knightly jousts and fierce encounters fit. Spenser.[Excuses] full knightly without scorn. Tennyson.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/knightly.mp3'),
(320, 'KECK', 'To heave or to retch, as in an effort to vomit. [R.] Swift.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/keck.mp3'),
(321, 'LIMULUS', 'The only existing genus of Merostomata. It includes only a fewspecies from the East Indies, and one (Limulus polyphemus) from theAtlantic coast of North America. Called also Molucca crab, king crab,horseshoe crab, and horsefoot.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/limulus.mp3'),
(322, 'LONGIROSTER', 'One of the Longirostres.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/longiroster.mp3'),
