(324, 'LUCIFERIAN', 'One of the followers of Lucifer, bishop of Cagliari, in thefourth century, who separated from the orthodox churches because theywould not go as far as he did in opposing the Arians.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/luciferian.mp3'),
