(329, 'LENGTHY', 'Having length; rather long or too long; prolix; not brief; --said chiefly of discourses, writings, and the like. "Lengthyperiods." Washington. "Some lengthy additions." Byron. "These wouldbe details too lengthy." Jefferson. "To cut short lengthyexplanations." Trench.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lengthy.mp3'),
