(335, 'LIGEANCE', 'The connection between sovereign and subject by which they weremutually bound, the former to protection and the securing of justice,the latter to faithful service; allegiance. [Written also ligeancyand liegance.] Chaucer.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/ligeance.mp3'),
