(337, 'LOOL', 'A vessel used to receive the washings of ores of metals.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lool.mp3'),
(338, 'LACERATE', 'To tear; to rend; to separate by tearing; to mangle; as, tolacerate the flesh. Hence: To afflict; to torture; as, to laceratethe heart.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lacerate.mp3'),
(339, 'LEPROSY', 'A cutaneous disease which first appears as blebs or as reddish,shining, slightly prominent spots, with spreading edges. These areoften followed by an eruption of dark or yellowish prominent nodules,frequently producing great deformity. In one variety of the disease,anÃ¦sthesia of the skin is a prominent symptom. In addition there maybe wasting of the muscles, falling out of the hair and nails, anddistortion of the hands and feet with destruction of the bones andjoints. It is incurable, and is probably contagious.Mycobacteriumleprae, curable in most cases by therapy with a combination ofantibiotics, but cases resistant to therapy are increasing.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/leprosy.mp3'),
(340, 'LYENCEPHALOUS', 'Pertaining to, or characteristic of, the Lyencephala.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lyencephalous.mp3'),
(341, 'LOCHIAL', 'Of or pertaining to the lochia.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lochial.mp3'),
(342, 'LITERALISM', 'The tendency or disposition to represent objects faithfully,without abstraction, conventionalities, or idealization.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/literalism.mp3'),
(343, 'LODGMENT', 'The occupation and holding of a position, as by a besiegingparty; an instrument thrown up in a captured position; as, to effecta lodgment.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lodgment.mp3'),
(344, 'LITHIC', 'Pertaining to the formation of uric-acid concretions (stone) inthe bladder and other parts of the body; as, lithic diathesis. LIthicacid (Old Med. Chem.), uric acid. See Uric acid, under Uric.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lithic.mp3'),
