(346, 'LAMENT', 'To express or feel sorrow; to weep or wail; to mourn.Jeremiah lamented for Josiah. 2 Chron. xxxv. 25.Ye shall weep and lament, but the world shall rejoice. John xvi. 20.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/lament.mp3'),
(347, 'LEVULOSAN', 'An unfermentable carbohydrate obtained by gently heatinglevulose.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/levulosan.mp3'),
