(374, 'MOMENT', 'An infinitesimal change in a varying quantity; an increment ordecrement. [Obs.]', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/moment.mp3'),
(375, 'MASTED', 'Furnished with a mast or masts; -- chiefly in composition; as,a three-masted schooner.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/masted.mp3'),
