(378, 'NUMB', 'To make numb; to deprive of the power of sensation or motion;to render senseless or inert; to deaden; to benumb; to stupefy.For lazy winter numbs the laboring hand. Dryden.Like dull narcotics, numbing pain. Tennyson.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/numb.mp3'),
(379, 'NEMOPHILIST', 'One who is fond of forest or forest scenery; a haunter of thewoods. [R.]', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nemophilist.mp3'),
(380, 'NARRATE', 'To tell, rehearse, or recite, as a story; to relate theparticulars of; to go through with in detail, as an incident ortransaction; to give an account of.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/narrate.mp3'),
(381, 'NIPPING', 'Biting; pinching; painful; destructive; as, a nipping frost; anipping wind.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nipping.mp3'),
(382, 'NAKEDNESS', 'The privy parts; the genitals.Ham ... saw the nakedness of his father. Gen. ix. 22.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nakedness.mp3'),
(383, 'NEZ PERCES', 'A tribe of Indians, mostly inhabiting Idaho.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nez perces.mp3'),
(384, 'NEGLIGENT', 'Apt to neglect; customarily neglectful; characterized bynegligence; careless; heedless; culpably careless; showing lack ofattention; as, disposed in negligent order. "Be thou negligent offame." Swift.He that thinks he can afford to be negligent is not far from beingpoor. Rambler.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/negligent.mp3'),
(385, 'NEAR-LEGGED', 'Having the feet so near together that they interfere intraveling. Shak.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/near-legged.mp3'),
(386, 'NORTHEASTERLY', 'Pertaining to the northeast; toward the northeast, or comingfrom the northeast.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/northeasterly.mp3'),
(387, 'NAPPE', 'Sheet; surface; all that portion of a surface that iscontinuous in such a way that it is possible to pass from any onepoint of the portion to any other point of the portion withoutleaving the surface. Thus, some hyperboloids have one nappe, and somehave two.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nappe.mp3'),
(388, 'NOTOTHERIUM', 'An extinct genus of gigantic herbivorous marsupials, found inthe Pliocene formation of Australia.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nototherium.mp3'),
(389, 'NERVOMUSCULAR', 'Of or pertaining to both nerves and muscles; of the nature ofnerves and muscles; as, nervomuscular energy.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nervomuscular.mp3'),
(390, 'NEBULAR', 'Of or pertaining to nebulÃ¦; of the nature of, or resembling, anebula. Nebular hypothesis, an hypothesis to explain the process offormation of the stars and planets, presented in various forms byKant, Herschel, Laplace, and others. As formed by Laplace, itsupposed the matter of the solar system to have existed originally inthe form of a vast, diffused, revolving nebula, which, graduallycooling and contracting, threw off, in obedience to mechanical andphysical laws, succesive rings of matter, from which subsequently, bythe same laws, were produced the several planets, satellites, andother bodies of the system. The phrase may indicate any hypothesisaccording to which the stars or the bodies of the solar system havebeen evolved from a widely diffused nebulous form of matter.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/nebular.mp3'),
(391, 'NIOBIC', 'Same as Columbic.', 'https://ssl.gstatic.com/dictionary/static/sounds/de/0/niobic.mp3'),
